import React from 'react';

const Myinput = () => {
    return (
        <form>
        <input
          value={text}
          placeholder="введите пост"
          onChange={(e) => setText(e.target.value)}
        />
       <button onClick={AddPost}> создать пост</button>
      </form>
    );
};

export default Myinput;
